import React, { useState, useEffect } from "react";
import {Helmet} from "react-helmet";
import data from './data.json';
import { ProductFilter } from "./homeowner-plans/ProductFilter";
import { ProductFilterResult } from "./homeowner-plans/ProductFilterResult";
const AboutUs = () =>{

const dataList = data.productList;

function App() {
 
  const [searchText, setSearchText] = useState("");
  const [data, setData] = useState(dataList);
 const handleChange =(e)=> {
setSearchText(e.target.value)

 }
 
  
 
  return (
    <div className="App">
      
      <select name="size" className=""onChange={handleChange} >
          {data.map(option => (
            <option key={option.id} value={option.id} >{option.unitsize}</option>
          ))}
        </select>
      <div className="option-cont table-right">
              {data.map(el => {
                return (
                  <div className="option" key={el.id}>
                    <div className="star-cont">
                     
                    </div>
                    <div className="body">
                      <h6 className="upper">{el.name}</h6>
                      <h4 className="lato">{el.price}
                        <span style={{ fontSize: "0.4em" }}>/MO</span></h4>
                      <h5 className="lato">{el.yearly}</h5>
                    </div>
                  </div>
                );
              })}

            </div>
    </div>
  );
}
 


    return(
       <>
          <Helmet>         
            <title>Learn more about Acclaimed Home Warranty Services: Award winning home warranty company in Utah, Arizona, Idaho, Texas, and Nevada</title>
            <meta name="description" content="Acclaimed Home Warranty in offers a range of plans &amp; coverage options for protecting your property from high repair costs."/>
          </Helmet>
        <h1>About Us Page</h1>

        <App/>
       </>
    )
};
export default AboutUs;
